// Belirli bir uçuş için detay endpointi
app.get('/api/states/:icao24', (req, res) => {
  const icao24 = req.params.icao24;
  
  // Gerçek bir API'de burada veritabanı sorgusu yapılırdı
  // Biz şimdilik sabit bir veri döndürelim
  
  if (icao24 === 'a1b2c3') {
    res.json({
      icao24: "a1b2c3",
      callSign: "THY123",
      originCountry: "Turkey",
      timePosition: Math.floor(Date.now() / 1000) - 35,
      lastContact: Math.floor(Date.now() / 1000) - 25,
      longitude: 28.9651,
      latitude: 41.0096,
      baroAltitude: 10000.5,
      onGround: false,
      velocity: 250.5,
      trueTrack: 45.2,
      verticalRate: 0.0,
      sensors: null,
      geoAltitude: 10200.5,
      squawk: "1200",
      spi: false,
      positionSource: 0
    });
  } else {
    res.status(404).json({ error: "Uçuş bulunamadı" });
  }
});

